import React from "react";
import useState from "react"
import {
  KeyboardDatePicker,
  MuiPickersUtilsProvider
} from "@material-ui/pickers";
import MomentUtils from "@date-io/moment";
import "moment/locale/ru";
import Button from '@material-ui/core/Button';
import Grid from '@material-ui/core/Grid';
import "../dtpic/dtpic.css"

import Datatab from "../datatab/datatab"
import axios from "axios";



class Dtpic extends React.Component {
  constructor(){
    super();
    this.state={
      api:0
    }
  }
  
  click = () => {
    //api = 'http://localhost:62499/api/zplist/' + document.getElementById("start").value + "&" + document.getElementById("end").value
    //console.log(api)
    let currentApi=this.state.api;
    console.log('http:localhost:62499/api/zplist/' + document.getElementById("start").value + "&" + document.getElementById("end").value)
    this.setState({
      api: currentApi
    })

  }
  render(){
    
    
    return (
      <div className="botmarg">
        <h3>{this.state.api}</h3>
        <Grid container spacing={3}>
          <Grid item xs>
            <div>
              <label htmlFor="start">Start date:</label>
              <input type="date" id="start" name="trip-start"></input>
              <label htmlFor="start">End date:</label>
              <input type="date" id="end" name="trip-start"></input>
       
       
            </div>
          </Grid>
          <Grid  item xs>
            <Button  onClick={this.click} variant="contained" color="secondary"  >
              Получить
            </Button>
          </Grid>
          <Grid item xs>
  
          </Grid>
        </Grid>
  
       
  
 
  
       
      </div>
    );
  }
}

export default Dtpic;
